import s from './Games.module.css'
import React from "react";
import Game from "./Game/Game";
import {object} from "./tictactoe";

const Games = () => {
    let gameElement = object.array.map( post => <Game name={post.name}
                                               id={post.id}
                                               dispatch={object.dispatch}/> );
    return (
        <div>
            <div>
                tic-tac-toe
            </div>
            <div className={s.items}>
                {gameElement}
            </div>
        </div>

    );
};

export default Games;
